INSERT INTO okt_import.track (name, geom)
SELECT
	REPLACE(relation #>> '{properties, name}', 'K, ', '') AS name,
	ST_GeomFromGeoJSON(relation -> 'geometry') AS geom
FROM (
	SELECT jsonb_path_query(geojson, '$.features[*] ? (@.id starts with "relation")') as relation
	FROM data
) q1
